import React from 'react'
import { useSelector, useDispatch } from 'react-redux';

const Cart = () => {
    const { products } = useSelector(state => state.CartReducer);
    return (
        <div className="cart">
            <div className="container">
                <h3>Your Cart</h3>
                {products.length > 0 ?
                
                
                 "You Have Product" : "You Do Not Have Product"}
            </div>
        </div>
    )
}

export default Cart
